//온누리 풀화면 응답
function MyResponseFull(result){
	//alert('status :' + result.status);
	if(result.status === 'OK'){
		console.log("온누리 광고 처리 됨");
		//닫기버튼준비
		showDiv('dvAdExWrapper');
		showDiv('dvAdExButtonX');
		document.getElementById('dvAdExWrapper').style.display = 'inline';
	}else if(result.status === 'NOBID'){
		hideExelbidDiv();//엑셀비드(온누리) 풀화면닫기버튼숨기기
		console.log("온누리 광고없음");
	}else if(result.status === 'PASSBACK'){
		console.log("온누리 PASSBACK");
	}else if(result.status === 'ERROR'){
		console.log("온누리 기타 에러");
	}
}
