function leadingZeros(n, digits){
    var zero = '';
    n = n.toString();

    if (n.length < digits){
        for (var i = 0; i < digits - n.length; i++)
            zero += '0';
    }
    return zero + n;
}
var iMathFloor = 0;
function Mathfloor(n)
{
    iMathFloor = n|0;
    if(iMathFloor < 0)
        return Math.floor(n);

    return iMathFloor;
}
